import React from 'react';

const Card = ({ book }) => {
  return (
    <div className="card" style={styles.card}>
      <img className="card-img-top" src="https://m.media-amazon.com/images/I/91U6rc7u0yL.jpg" alt="Card image cap" style={styles.img}/>
      <div className="card-body">
        <h5 className="card-title">{book.title}</h5>
        <h6 className="card-subtitle mb-2 text-muted">{book.subtitle}</h6>
        <p className="card-text">{book.desc}</p>
        <a href="#" className="btn btn-primary">Go somewhere</a>
      </div>
    </div>
  );
}

const styles = {
  card: {
    width: '250px',  // Fixed width of the card
    height: '400px', // Fixed height of the card
    margin: '2%',
    overflow: 'hidden',  // Prevents overflow content
  },
  img: {
    width: '100%',  // Ensures the image fills the card width
    height: '200px', // Fixed height for the image
    objectFit: 'cover',  // Makes sure the image covers the area without distortion
  }
};

export default Card;
